import React from "react";

class SearchBar extends React.Component {
    onChange(e){
        console.log(e)
    }
    render(){
        return(
            <div className="d-flex justify-content-center mt-4">
                <form>
                    <input onChange={this.onChange} type="text" className="border border-3 rounded-2 p-1"></input>
                </form>
                <button className="btn btn-outline-success mx-1 p-1 px-2">Search</button>
            </div>
        )
    }
}

export default SearchBar;
